/* i really want this to be global */
.main-navbar {
    border-radius: 5px;
    background: linear-gradient(to right,  black, darkred);
    background-size: 400%;
}

.block.w-20 > svg {
    display: none; /* Hide the SVG element */
}

a.block.w-20 {
    width: 80px; /* Set the width of the anchor element */
    height: 50px; /* Set the height of the anchor element */
    background-image: url('https://i.imgur.com/6Q7c3LL.png'); /* Set the background image */
    background-size: cover; /* Ensure the background image covers the entire area */
    background-position: center; /* Center the background image */
    text-indent: -9999px; /* Move the anchor text off-screen */
    overflow: hidden; /* Hide any overflowing content */
}


.vjs-tech {
    border-radius: 20px;
}

